export function Publisher() { return "AlexC#5112"; }
export function Size() { return [60,25]; }
export function DefaultPosition() {return [100,100]; }
export function DefaultScale(){return 4.0}
export function ControllableParameters(){
    return [
        {"property":"shutdownColor", "label":"Shutdown Color","min":"0","max":"360","type":"color","default":"009bde"},
        {"property":"LightingMode", "label":"Lighting Mode", "type":"combobox", "values":["Canvas","Forced"], "default":"Canvas"},
        {"property":"forcedColor", "label":"Forced Color","min":"0","max":"360","type":"color","default":"009bde"},
    ];
}

export function ConflictingProcesses() {
    return ["NGenuity2.exe"];
}


var vLedNames = [
    "LED Right", "LED Left"
];


var vLedPositions = [
    [1,0],[0,0]
];

export function LedNames() {return vLedNames;}
export function LedPositions() {return vLedPositions;}
export function Shutdown() {sendColors(true);}

function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
}

export function Validate(endpoint)
{
    return endpoint.interface === 1 // && endpoint.usage === 0x0001 && endpoint.usage_page == 0x000c;
}

function sendReportString(string, size){
    var packet= [];
    var data = string.split(' ');
    
    for(let i = 0; i < data.length; i++){
        packet[parseInt(i,16)] = parseInt(data[i],16)//.toString(16)
    }

    device.send_report(packet, size);
}

function sendColors(shutdown = false){

    var packet = []

    for(var iIdx = 0; iIdx < vLedPositions.length; iIdx++)
    {

        var col;
        
        var iX = vLedPositions[iIdx][0];
        var iY = vLedPositions[iIdx][1];
    
        var color;
        if(shutdown){
            color = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            color = hexToRgb(forcedColor)
        }else{
            color = device.color(iX, iY);
        }

        if(iIdx == 0){
            packet[0] = color[0].toString(16);
            packet[1] = color[1].toString(16);
            packet[2] = color[2].toString(16);
        }
        else{
            packet[3] = color[0].toString(16);
            packet[4] = color[1].toString(16);
            packet[5] = color[2].toString(16);
        }
     }
    
    // needed to initialize a communication or to tell the hardware to expect RGB data.
    // NGenuity.exe sends a lot more packages before HEX RGB data but looks like only this one is needed. 
    sendReportString(
        "00 04 f2 00 00 00 00 00 00 02",100
    );

    // any debugging of colours and format
    // device.log("00 81 "+packet[0]+" "+packet[1]+" "+packet[2]+" 81 "+packet[3]+" "+packet[4]+" "+packet[5]+"")

    // 00 hex is removed by sendReportString, only 0x81 are relevant which define where RGB data stars per LED
    sendReportString("00 81 "+packet[0]+" "+packet[1]+" "+packet[2]+" 81 "+packet[3]+" "+packet[4]+" "+packet[5]+"",100)

    device.pause(1);
}


export function Render() {sendColors();}


